Hello. This seems to use only 4 cpu cores, but the pc has 16. How to make it use all the cores?
I run it in WSL, but I have not limited it, and in fact to be sure I raised it to 16 CPU cores.
Thanks

```

SELECT pgml.transform(
    task => '{
      "task": "text-generation",
      "model": "TheBloke/falcon-40b-instruct-GGML"
    }'::JSONB,
    inputs => ARRAY[
        'Please summarize the following article:
		June 30 (Reuters) - Artificial intelligence chips...'
    ],
    args => '{"max_new_tokens": 2000}'::JSONB
);

```
